import React from 'react'
import { Link } from 'react-router-dom'

const PostLayout = () => {
  return (
    <div>
       <Link to="/postage/1">Post 1</Link><br />
      <Link to="/postage/2">Post 2</Link><br />
      <Link to="/postage/3">Post 3</Link><br />
      <Link to="/postage/newpost">New Post</Link><br />
    </div>
  )
}

export default PostLayout
